#include <stdio.h>
#include <string.h>
#include <stdlib.h>

int base64_decode_char(char c);
void base64_decode(const char *src, unsigned char *target);

int main() {

    char sourceImg[] = "";

    
    int src_len = strlen(sourceImg);

    int target_len = (src_len * 3) / 4;

    unsigned char *decodedImg = malloc(target_len);

    base64_decode(sourceImg, decodedImg);

    FILE *imagem;
    imagem = fopen("img.jpg", "wb");

    if (!imagem) {
        printf("Erro ao abrir o arquivo para escrita!\n");
        return 1;
    }
    
    fwrite(decodedImg, sizeof(unsigned char), target_len, imagem);
    fclose(imagem);
    free(decodedImg);
    printf("Imagem gravada com sucesso!\n");

    return 0;
}

int base64_decode_char(char c) {
    if (c >= 'A' && c <= 'Z') return c - 'A';
    if (c >= 'a' && c <= 'z') return c - 'a' + 26;
    if (c >= '0' && c <= '9') return c - '0' + 52;
    if (c == '+') return 62;
    if (c == '/') return 63;
    return -1;  
}

void base64_decode(const char *src, unsigned char *target) {
    int len = strlen(src);
    int j = 0;
    for (int i = 0; i < len; i += 4) {
        unsigned char a = base64_decode_char(src[i]);
        unsigned char b = base64_decode_char(src[i + 1]);
        unsigned char c = base64_decode_char(src[i + 2]);
        unsigned char d = base64_decode_char(src[i + 3]);

        target[j++] = (a << 2) | (b >> 4);
        target[j++] = (b << 4) | (c >> 2);
        target[j++] = (c << 6) | d;
    }
}